import React from 'react';
import "../Asserts/Css/ComponentsCss/navbar.css";

const Navbar = () => {
    return (

       < div className='navbar'>
              <ul>
                <li className='dropdown'>Study Abroad</li>
                <li className='dropdown'>What We do ?</li>
                <li className='dropdown'>Study Destination</li>
                <li className='dropdown' >Other Services</li>
                <li className='dropdown'>Training</li>
              </ul>

            </div>

    )}

    
    export default Navbar;
